import React, { useEffect } from "react";
import { NavLink } from "react-router-dom";

import "../CSS/matchSelector.css";
function MatchTypeSelector(props) {
  return (
    <div>
      <br />
      <div className="row">
        <div className="col-1"></div>
        {props.type === "stats" ? (
          <div className="col-5">
            <NavLink to="/registermatch">
              <h6 className="tab">Register Match</h6>
            </NavLink>
          </div>
        ) : (
          <div className="col-5">
            <NavLink to="/stats">
              <h6 className="">All</h6>
            </NavLink>
          </div>
        )}
        {props.type === "compare" ? (
          <div className="col-5">
            <NavLink to="/addteamtomatch">
              <h6>Match Stats</h6>
            </NavLink>
          </div>
        ) : (
          <div className="col-5">
            <NavLink to="/compare">
              <h6 className="">Compare</h6>
            </NavLink>
          </div>
        )}
        <div className="col-1"></div>
      </div>
    </div>
  );
}

export default MatchTypeSelector;
